      out.write("                    Inland cities like Marrakech have a hot desert climate, with scorching \r\n");
      out.write("                    summers and cooler winters. The Atlas Mountains witness snow in winter. \r\n");
      out.write("                    The Sahara Desert is extremely hot during the day and can be cold at night. \r\n");
      out.write("                    It's best to plan based on the region and the time of year for your \r\n");
      out.write("                    preferred weather.\r\n");
      out.write("                </div>\r\n");
