      out.write("                </button>\r\n");
      out.write("                <div class=\"faq-answer hidden p-4 text-gray-700 leading-relaxed\">\r\n");
      out.write("                    Morocco is multilingual, with Arabic being the official language. \r\n");
      out.write("                    Moroccan Arabic (Darija) is widely spoken. Berber languages, such as \r\n");
      out.write("                    Tamazight, are also common, especially in rural areas. French is used \r\n");
      out.write("                    in government, business, and education, and many Moroccans are proficient \r\n");
      out.write("                    in it. English is increasingly spoken in tourist areas, but proficiency \r\n");
      out.write("                    may vary. Embracing basic Arabic phrases or French can enhance your \r\n");
      out.write("                    travel experience.\r\n");
      out.write("                </div>\r\n");
