      out.write("                    <span>11 thing to do in Morocco</span>\r\n");
      out.write("                    <svg class=\"w-5 h-5 transform transition-transform duration-200\" fill=\"none\" stroke=\"currentColor\" viewBox=\"0 0 24 24\">\r\n");
      out.write("                        <path stroke-linecap=\"round\" stroke-linejoin=\"round\" stroke-width=\"2\" d=\"M12 6v12m6-6H6\"/>\r\n");
      out.write("                    </svg>\r\n");
      out.write("                </button>\r\n");
      out.write("                <div class=\"faq-answer hidden p-4 text-gray-700 leading-relaxed\">\r\n");
      out.write("                    <ul class=\"list-disc list-inside space-y-4 text-gray-700\">\r\n");
      out.write("                        Morocco offers a wide range of activities to suit different interests. Here are some things to do in Morocco:\r\n");
      out.write("                        <li>Explore Marrakech: Wander through the vibrant souks, visit the historic Medina, and marvel at iconic sites like Jardin Majorelle and Koutoubia Mosque.</li>\r\n");
      out.write("                        <li>Visit Fes: Explore the ancient Fes Medina, home to historic landmarks such as Bou Inania Madrasa and the Al-Attarine Madrasa.</li>\r\n");
      out.write("                        <li>Experience the Sahara Desert: Take a camel trek into the mesmerizing dunes of the Sahara, and spend a night in a traditional desert camp.</li>\r\n");
      out.write("                        <li>Discover Chefchaouen: Explore the blue-painted streets of Chefchaouen nestled in the Rif Mountains, known for its picturesque charm.</li>\r\n");
      out.write("                        <li>Visit Casablanca: Explore Morocco's economic and business hub, visit the Hassan II Mosque, and experience the coastal atmosphere.</li>\r\n");
      out.write("                        <li>Explore Essaouira: Enjoy the coastal charm of Essaouira, known for its historic medina, sandy beaches, and vibrant arts scene.</li>\r\n");
      out.write("                        <li>Hike the Atlas Mountains: Embark on trekking adventures in the Atlas Mountains, where you can discover Berber villages and breathtaking landscapes.</li>\r\n");
      out.write("                        <li>Discover Rabat: Visit the capital city, Rabat, and explore historical sites like the Kasbah of the Udayas and the Royal Palace.</li>\r\n");
      out.write("                        <li>Experience Moroccan Cuisine: Indulge in the diverse and flavorful Moroccan cuisine, trying dishes like tagine, couscous, and mint tea.</li>\r\n");
      out.write("                        <li>Shop in Souks: Wander through the bustling souks (markets) in various cities, such as Marrakech or Fes, and shop for spices, textiles, and traditional crafts.</li>\r\n");
      out.write("                        Remember to adapt your activities based on your interests and the time of year you're visiting. Morocco's diverse landscapes and cultural richness offer a wide array of experiences for every traveler.\r\n");
      out.write("                    </ul>\r\n");
