      out.write("                    <span>Tell me about the history of Morocco</span>\r\n");
      out.write("                    <svg class=\"w-5 h-5 transform transition-transform duration-200\" fill=\"none\" stroke=\"currentColor\" viewBox=\"0 0 24 24\">\r\n");
      out.write("                        <path stroke-linecap=\"round\" stroke-linejoin=\"round\" stroke-width=\"2\" d=\"M12 6v12m6-6H6\"/>\r\n");
      out.write("                    </svg>\r\n");
