      out.write("                <div class=\"faq-answer hidden p-4 text-gray-700 leading-relaxed\">\r\n");
      out.write("                    <ul class=\"list-disc list-inside space-y-4 text-gray-700\">\r\n");
      out.write("                        The history of Morocco is rich and diverse, marked by various influences and periods. Here's a concise overview:\r\n");
      out.write("                        <li>Ancient Morocco: Phoenicians, Carthaginians, and Romans were among the early civilizations in Morocco. The Berbers, indigenous people, have a deep-rooted history.</li>\r\n");
      out.write("                        <li>Islamic Era: Arab-Muslim influence began in the 7th century. Morocco became a center of Islamic culture, and various dynasties ruled, including the Almoravids and Almohads.</li>\r\n");
      out.write("                        <li>Al-Andalus Influence: In the medieval period, Morocco had ties with Al-Andalus (Islamic Iberia), leading to cultural and architectural influences.</li>\r\n");
      out.write("                        <li>Saadian and Alaouite Dynasties: The Saadian Dynasty ruled in the 16th century, followed by the Alaouite Dynasty, which continues to rule today. The Alaouite Sultanate established stability and expanded Morocco's influence.</li>\r\n");
      out.write("                        <li>European Colonialism: In the 19th and early 20th centuries, European powers, particularly France and Spain, sought influence in Morocco, leading to conflicts. The Treaty of Fez in 1912 made Morocco a French and Spanish protectorate.</li>\r\n");
      out.write("                        <li>Independence: Morocco regained independence in 1956. King Mohammed V led the nationalist movement, and his son, Hassan II, became king in 1961.</li>\r\n");
      out.write("                        <li>Modern Period: Morocco has since modernized while preserving its cultural identity. The country has been politically stable compared to some regional neighbors.</li>\r\n");
      out.write("                        Throughout its history, Morocco has been a crossroads of cultures, resulting in a unique blend of Arab, Berber, and European influences that contribute to its distinctive identity.\r\n");
      out.write("                    </ul>\r\n");
