      out.write("                <div class=\"faq-answer hidden p-4 text-gray-700 leading-relaxed\">\r\n");
      out.write("                    Traditional Moroccan clothing includes the djellaba, a long hooded robe worn by both men and women.\r\n");
      out.write("                    Women often wear kaftans, intricately designed dresses, and hijabs or headscarves.\r\n");
      out.write("                    Men may also wear a fez, a distinctive hat. In rural areas, you might see Berber men in traditional robes and turbans.\r\n");
      out.write("                    The attire often reflects the rich cultural and historical influences in Morocco.\r\n");
      out.write("                </div>\r\n");
